  KEY `kode` (`kode`),
  KEY `nama` (`nama`),
  KEY `nip` (`nip`),
  KEY `nama_gelar` (`nama_gelar`),
  KEY `aktif` (`aktif`),
  KEY `diinput_tanggal` (`diinput_tanggal`),
  KEY `diperbaharui_tanggal` (`diperbaharui_tanggal`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='Referensi Hakim Pengadilan Tinggi';

